'''
Given a string s, you are allowed to convert it to a palindrome by adding characters in front of it. Find and return the shortest palindrome you can find by performing this transformation.

Example 1:

Input: "aacecaaa"
Output: "aaacecaaa"
Example 2:

Input: "abcd"
Output: "dcbabcd"

1 Test case failed which is as follows. Can't be arsed.
""
'''

class Solution:
    def isPalindrome(self, s1: str) -> bool:
        while True:
            if s1[0]==s1[-1]:
                s1=s1[1:-1]
            else:
                return False
            if len(s1)==0 or len(s1)==1:
                return True
    def shortestPalindrome(self, s: str) -> str: 
        if s=='' or len(s)==1:
            return s
        if self.isPalindrome(s):
            return s
        j=-1
        while True:
            s2=''
            s2=s[j:]
            s2=s2[::-1]+s
            if self.isPalindrome(s2):
                return s2
            j=j-1

def stringToString(input):
    import json

    return json.loads(input)

def main():
    import sys
    import io
    def readlines():
        for line in io.TextIOWrapper(sys.stdin.buffer, encoding='utf-8'):
            yield line.strip('\n')

    lines = readlines()
    while True:
        try:
            line = next(lines)
            s = stringToString(line);
            
            ret = Solution().shortestPalindrome(s)

            out = (ret);
            print(out)
        except StopIteration:
            break

if __name__ == '__main__':
    main()